import logo from './logo.svg';
import './App.css';
import Loginpage from './Components/Loginpage';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route index element={<Loginpage/>} ></Route>

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
